import './App.css';
import NavBar from './Components/NavBar/NavBar';
import Banner from './Components/Banner/Banner';
import About from './Components/About/About';
import Footer from './Components/Footer/Footer';


function App() {
  return (
    <div className="App">
      <NavBar />  
      <Banner />
      <About />

      <Footer />
    </div>
  );
}

export default App;
